import React from 'react';
import './css/App.css';

function App() {
  return (
    <div className="App">
        <div className="h1 title"> emily tao </div>
        <span class="h2 rotatingText-adjective">developer </span>
        <span class="h2 rotatingText-adjective"> designer </span>
        <span class="h2 rotatingText-adjective"> engineer </span>

        {/* <div className="h2 description"> developer, designer, engineer </div> */}
    </div>
  );
}

export default App;
